            if (preRecordedResponse.RequestParamsOption.IsSet)
            {
                writer.WritePropertyName("request_params");
                JsonSerializer.Serialize(writer, preRecordedResponse.RequestParams, jsonSerializerOptions);
            }
            if (preRecordedResponse.ResultOption.IsSet)
            {
                writer.WritePropertyName("result");
                JsonSerializer.Serialize(writer, preRecordedResponse.Result, jsonSerializerOptions);
            }
        }
    }
}
